// Dashboard.js

import React from 'react';
import { Link } from 'react-router-dom';

const Dashboard = () => {
  return (
    <div>
      <h1>Dashboard</h1>
      <Link to="/task1">
        <button>Task 1</button>
      </Link>
      <Link to="/task2">
        <button>Task 2</button>
      </Link>
      <Link to="/task3">
        <button>Task 3</button>
      </Link>
    </div>
  );
};

export default Dashboard;
